import Hero from '../../Components/Hero/Hero';
import WoW from '../../Components/Project-WoW/ProjectWoW'

export class Main extends Component {
  render() {
    return (
      <>
        <Hero />
        <section className="projectsContainer">
          <WoW />
        </section>
      </>
    )
  }
}

export default Main;
